import React from 'react';
import './App.css';
import styled from 'styled-components';

const SearchBar = styled.div`
  margin: auto;
  width: 35%;
  height: 60%;
  background-color: white;
  position: absolute:
  top: 40%;
  padding-left: 20px;
  min-width: 200px;
`;

const SearchButton = styled.button`
  margin: auto;
  width: 10%;
  height: 60%;
  background-color: pink;
  position: absolute:
  top: 40%;
  padding-left: 10px;
  border: 0;
  min-width
`;

function App() {
  return (
    <div className="bg-image">
      <div className="flex-container">
        <SearchBar>
            Hi
        </SearchBar>
        <SearchButton>
            Hi
        </SearchButton>
      </div>
    </div>
  );
}

export default App;
